class Solution {
  int countInterestingSubarrays(List<int> nums, int modulo, int k) {
    int count = 0;
    for (int start = 0; start < nums.length; start++) {
      int cnt = 0;
      for (int end = start; end < nums.length; end++) {
        if (nums[end] % modulo == k) cnt++;
        if (cnt % modulo == k) count++;
      }
    }
    return count;
  }
}
